features.script:
let adOne = parcel.getFeatureById('Advert1');
//let adTwo = parcel.getFeatureById('Advert2');  

let items = [];
let count = 0;
let numMilliseconds = 12000 //one seconds
let rotatingAd = parcel.getFeatureById('AdvertRotate');
let isRotating = false; 

//only run rotating if element is present
if (rotatingAd) {
  isRotating = true;
} 

parcel.on('playerenter', e => {
  fetch('https://us-central1-nlwpower.cloudfunctions.net/getAds')
   .then(response => response.json())
   .then(result=> {     
      console.log('res', result);       

      let adcount = result.length;

      if (adcount > 0){
        adOne.set({'url':result[0].data.ad_media_url});
        adOne.set({'link': result[0].data.ad_link_url});  
      } 

      if (isRotating) {
        for(var i=0; i < result.length; i++) {
          let image = result[i].data;

          items.push(image);                
        }

        rotatingAd.set({'url' : result[0].data.ad_media_url}); 
        rotatingAd.set({'link' : result[0].data.ad_link_url});
      }      

      console.log('items', items); 
      console.log('rotating?', isRotating);  
   });
})

if (isRotating) {  
  setInterval( ()=>{

    if (items.length > 0) {
      if (count < items.length -1){
        count++; 
      }
      else {
        count = 0;
      }

      rotatingAd.set({'url' : items[count].data.ad_media_url}); 
      rotatingAd.set({'link' : items[count].data.ad_link_url});     
    }  

  },numMilliseconds)  
}

